import * as React from "react";
import { useState } from "react";
import "./App.css";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Modal from "@mui/material/Modal";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import { withRouter } from "react-router";
import { useSelector } from "react-redux";
import { updateData } from "./apiServices";
import { style } from "./boxStyle";

function EditUser(props) {
  const filterData = useSelector((state) => state.service.singleData);
  const [open, setOpen] = useState(false);

  const [user, setUser] = useState({
    name: filterData.name,
    email: filterData.email,
    role: filterData.role,
    address: filterData.address,
    mob_no: filterData.mob_no,
    password: filterData.password,
    price: filterData.price,
  });

  const handleClick = () => {
    let data = {
      name: user.name,
      email: user.email,
      mob_no: user.mob_no,
      role: user.role,
      address: user.address,
      password: user.password,
      price: user.price,
    };

    updateData(data, filterData.id);

    if (
      user.name !== "" &&
      user.email !== "" &&
      user.mob_no !== "" &&
      user.password !== "" &&
      user.role !== "" &&
      user.price !== "" &&
      user.address !== ""
    ) {
      setOpen(true);
      setTimeout(() => {
        props.history.push({
          pathname: "/userDetails",
          state: { email: user.email },
        });
      }, 2000);
    } else {
      alert("Fill all the data properly");
    }
  };

  return (
    <div className="background">
      <form id="form" action="">
        <h1>Update your details</h1>
        <br />
        <TextField
          id="outlined-required"
          required
          className="input"
          label="First Name"
          placeholder="Enter your first name here"
          value={user.name}
          onChange={(event) =>
            setUser((previousState) => {
              return { ...previousState, name: event.target.value };
            })
          }
        />{" "}
        <br /> <br />
        <TextField
          id="outlined-required"
          required
          className="input"
          label="Email"
          placeholder="Enter your mail here"
          value={user.email}
          onChange={(event) =>
            setUser((previousState) => {
              return { ...previousState, email: event.target.value };
            })
          }
        />
        <br /> <br />
        <TextField
          id="outlined-number"
          required
          className="input"
          autoComplete="username"
          label="Mobile Number"
          type="number"
          value={user.mob_no}
          onChange={(event) =>
            setUser((previousState) => {
              return { ...previousState, mob_no: event.target.value };
            })
          }
        />{" "}
        <br /> <br />
        <TextField
          id="outlined-required"
          required
          className="input"
          label="address"
          placeholder="Enter your address here"
          value={user.address}
          onChange={(event) =>
            setUser((previousState) => {
              return { ...previousState, address: event.target.value };
            })
          }
        />
        <br />
        {user.role !== null && (
          <Box sx={{ maxWidth: "50%", marginLeft: 23 }}>
            <FormControl fullWidth>
              <InputLabel id="demo-simple-select-label">Service</InputLabel>
              <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                value={user.role}
                label="role"
                onChange={(event) =>
                  setUser((previousState) => {
                    return { ...previousState, role: event.target.value };
                  })
                }
                required
                autoComplete="role"
              >
                <MenuItem value={"plumber"}>plumber</MenuItem>
                <MenuItem value={"washerman"}>washerman</MenuItem>
                <MenuItem value={"electrician"}>electrician</MenuItem>
              </Select>
            </FormControl>
          </Box>
        )}
        <br />
        {user.price !== null && (
          <span>
            <TextField
              id="outlined-number"
              autoComplete="price"
              label="Price"
              type="number"
              required
              className="input"
              value={user.price}
              onChange={(event) =>
                setUser((previousState) => {
                  return { ...previousState, price: event.target.value };
                })
              }
            />{" "}
            <br /> <br />
          </span>
        )}
        <span className="note">
          {" "}
          Enter new password, don't fill this field empty otherwise your data{" "}
          will not update !
        </span>
        <br />
        <br />
        <TextField
          id="outlined-number"
          autoComplete="password"
          label="password"
          type="password"
          required
          className="input"
          value={user.password}
          onChange={(event) =>
            setUser((previousState) => {
              return { ...previousState, password: event.target.value };
            })
          }
        />
        <br /> <br />
        <Button
          onClick={handleClick}
          className="btn1"
          variant="outlined"
          color="success"
        >
          Update
        </Button>
        <Button
          onClick={() =>
            props.history.push({
              pathname: "/userDetails",
              state: { email: user.email },
            })
          }
          variant="outlined"
          color="error"
          className="btn2"
        >
          Cancel
        </Button>
      </form>
      <Modal
        open={open}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
          <Typography id="modal-modal-title" variant="h5" component="h1">
            Data Updated Successfully
          </Typography>
        </Box>
      </Modal>
    </div>
  );
}

export default withRouter(EditUser);
